import React from 'react';
import './navbar.css';

const NavBar = () => {
  return (
    <header className="navbar">
      <nav className="navbar">
        <a className="logo" href="/"><img className='logo-img' src="/assets/img/logo.png" alt="" height={50} /></a>
        <ul className="nav-links">

        </ul>
      </nav>
    </header>
  );
}

export default NavBar;
